import { LightningElement, api } from 'lwc';
import { loadScript } from 'lightning/platformResourceLoader';

// Static resources
import JSPDF from '@salesforce/resourceUrl/jspdf_latest';
import signatureImage from '@salesforce/resourceUrl/signatureImageTrans';
import sealImage from '@salesforce/resourceUrl/seal';
import headerImage from '@salesforce/resourceUrl/certificateHeader';

// DB call
import getCertPharmacyLicenseController from '@salesforce/apex/PdfGenerator.getCertPharmacyLicenseController';

export default class Cert_pharmarcy_licen extends LightningElement {
  @api recordId;
  
  currentRecordId;

  connectedCallback() {
    this.currentRecordId = this.recordId;
  }

  renderedCallback() {
    Promise.all([
      loadScript(this, JSPDF),
      fetch(signatureImage).then((response) => response.blob()),
      fetch(sealImage).then((response) => response.blob()),
      fetch(headerImage).then(response => response.blob()),
    ]).then(([jspdf, signatureBlob, sealBlob, headerBlob]) => {
      const signatureReader = new FileReader();
      signatureReader.readAsDataURL(signatureBlob);
      signatureReader.onloadend = () => {
        this.signatureDataURL = signatureReader.result;
      };

      const sealReader = new FileReader();
      sealReader.readAsDataURL(sealBlob);
      sealReader.onloadend = () => {
        this.sealDataURL = sealReader.result;
      };

      const headerReader = new FileReader();
			headerReader.readAsDataURL(headerBlob);
      headerReader.onloadend = () => {
          this.headerDataURL = headerReader.result;
      };
    });
  }

  async generatePdf() {
  try {
    const result = await getCertPharmacyLicenseController({currentRecordId: this.currentRecordId})

    const { jsPDF } = window.jspdf;
		const doc = new jsPDF('l', 'mm', [279.4, 215.9]);
    const base64 =
      '';

    // Add the custom font to jsPDF
    doc.addFileToVFS('CloisterBlack.ttf', base64);
    doc.addFont('CloisterBlack.ttf', 'CloisterBlack', 'normal');
    doc.setFont('CloisterBlack');

    // Define margins
    const margin = {
      top: 40,
      right: 20,
      bottom: 20,
      left: 25,
    };

    const pageWidth = doc.internal.pageSize.getWidth();

    let yPos = margin.top+10; // Start position for subsequent lines
    let xPos = margin.left;

		let imageHeight = 55;
		let imageWidth = 230;
		let imageX = (pageWidth - imageWidth) / 2;
		doc.addImage(this.headerDataURL, 'JPEG', imageX, yPos - imageHeight/2, imageWidth, imageHeight);
		yPos += 45;

    doc.setFontSize(32);
		const textLines2 = "This certifies that";
		let lineWidth2 = doc.getTextWidth(textLines2);
		let lineX2 = (pageWidth - lineWidth2) / 2;
		for (let offset = 0; offset < 0.4; offset += 0.1) {
            doc.text(textLines2, lineX2 + offset, yPos + offset);
        }

    // SUB TITLE 3
    const subTitle3 = [result?.Registrant__r?.Name ?? ''];
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(16);
    yPos += 8; // Start position for subsequent lines
    subTitle3.forEach((line) => {
      const lineWidth = doc.getTextWidth(line);
      const lineX = (pageWidth - lineWidth) / 2;
      doc.text(line, lineX, yPos);
    });

    // SUB TITLE 4
    const subTitle4 = [result?.Registrant__r?.BillingStreet ?? '', `${result?.Registrant__r?.BillingCity ? `${result?.Registrant__r?.BillingCity},` : ''} ${result?.Registrant__r?.BillingState ?? ''}`];
    doc.setFont('helvetica', 'normal');
    yPos += 7; // Start position for subsequent lines
    subTitle4.forEach((line) => {
      const lineWidth = doc.getTextWidth(line);
      const lineX = (pageWidth - lineWidth) / 2;
      doc.text(line, lineX, yPos);
      yPos += 6; // Increment y position for each line
    });

    let pharOwnerName = result?.Pharmacy_Owner_Account__r?.Name ?? '           ';
    let pharManagerNameFirstName = result?.Registrant__r?.Pharmacy_Manager__r?.FirstName ?? '               ';
    let pharManagerNameLastName = result?.Registrant__r?.Pharmacy_Manager__r?.LastName ?? '              ';
    let pharManagerName = `${pharManagerNameFirstName} ${pharManagerNameLastName}`;


    yPos += 4; // Start position for subsequent lines
    doc.setFont('CloisterBlack', 'normal');
    doc.setFontSize(20);

    doc.text('is a duly registered and accredited Pharmacy under the Pharmacy Act of Nova Scotia', margin.left, yPos);
    yPos+=8;

    // TEXT LINES 2
    const textLine2 =
      `in the name of ${pharOwnerName}, the pharmacy owner, and further that the licence for the operation of this pharmacy is issued to ${pharManagerNameFirstName} ${pharManagerNameLastName}, the pharmacy manager. This pharmacy is entitled to all the rights and privileges appertaining thereto, while, duly licensed.`;
    
    
    const availableWidth = pageWidth - (margin.left+margin.right);

    let lines = [];
    let currentLine = "";
    let currentWidth = 0;

    textLine2.split(' ').forEach((word) => {
        let wordWidth;
        if (pharOwnerName.includes(word) || pharManagerNameFirstName.includes(word) || pharManagerNameLastName.includes(word)) {
            // Bold and larger font for variable text
            doc.setFontSize(20);
            doc.setFont('helvetica', 'bold');
            wordWidth = doc.getTextWidth(word+" ");
        } else {
            // Regular font for other text
            doc.setFontSize(20);
            doc.setFont('CloisterBlack', 'normal');
            wordWidth = doc.getTextWidth(word+" ");
        }

        // Check if adding this word would exceed the maxWidth
        if (currentWidth + wordWidth < availableWidth) {
            currentLine += word + " ";
            currentWidth += wordWidth;
        } else {
            lines.push(currentLine.trim());
            currentLine = word + " ";
            currentWidth = wordWidth;
        }
    });

    if (currentLine) {
        lines.push(currentLine.trim());
    }


    let standardWidth, part1Width;
   
    lines.forEach((line, index) => {
      if(line.includes(pharOwnerName)){
        line = line.split(pharOwnerName);
        doc.text(line?.[0], margin.left, yPos);

        part1Width = doc.getTextWidth(line?.[0]);

        doc.setFontSize(20);
        doc.setFont('helvetica', 'bold');
        doc.text(pharOwnerName, margin.left + part1Width, yPos);

        standardWidth = doc.getTextWidth(pharOwnerName);

        doc.setFontSize(20);
        doc.setFont('CloisterBlack', 'normal');

        doc.text(line?.[1], margin.left + part1Width + standardWidth, yPos);
      }else if(line.includes(pharManagerNameFirstName) && line.includes(pharManagerNameLastName)){
        line = line.split(pharManagerName);
        doc.text(line?.[0], margin.left, yPos);

        part1Width = doc.getTextWidth(line?.[0]);

        doc.setFontSize(20);
        doc.setFont('helvetica', 'bold');
        doc.text(pharManagerName, margin.left + part1Width, yPos);

        standardWidth = doc.getTextWidth(pharManagerName);

        doc.setFontSize(20);
        doc.setFont('CloisterBlack', 'normal');

        doc.text(line?.[1], margin.left + part1Width + standardWidth, yPos);
      }else if(line.includes(pharManagerNameFirstName)){
        line = line.split(pharManagerNameFirstName);
        doc.text(line?.[0], margin.left, yPos);

        part1Width = doc.getTextWidth(line?.[0]);

        doc.setFontSize(20);
        doc.setFont('helvetica', 'bold');
        doc.text(pharManagerNameFirstName, margin.left + part1Width, yPos);

        standardWidth = doc.getTextWidth(pharManagerNameFirstName);

        doc.setFontSize(20);
        doc.setFont('CloisterBlack', 'normal');

        doc.text(line?.[1], margin.left + part1Width + standardWidth, yPos);
      }else if(line.includes(pharManagerNameLastName)){
        line = line.split(pharManagerNameLastName);
        doc.text(line?.[0], margin.left, yPos);

        part1Width = doc.getTextWidth(line?.[0]);

        doc.setFontSize(20);
        doc.setFont('helvetica', 'bold');
        doc.text(pharManagerNameLastName, margin.left + part1Width, yPos);

        standardWidth = doc.getTextWidth(pharManagerNameLastName);

        doc.setFontSize(20);
        doc.setFont('CloisterBlack', 'normal');

        doc.text(line?.[1], margin.left + part1Width + standardWidth, yPos);
      }else{
        doc.text(line, xPos, yPos);
      }
      xPos = margin.left;
      yPos += 8.5;
    });

    // Footer
    // Left side
    const today  = new Date();
    const footerLeft = [
      'Dated at Halifax, in the Province of Nova Scotia',
      today.toLocaleDateString("en-US", {year: 'numeric', month: 'long', day: 'numeric'})
    ];
    doc.setFontSize(13);
    yPos = 184;
    footerLeft.forEach((line) => {
      const lineWidth = doc.getTextWidth(line);
      const lineX = (pageWidth - lineWidth) / 2;
      doc.text(line, margin.left, yPos);
      yPos += 6; // Increment y position for each line
    });

    // License Number
		const license_number = result?.NSCP_Registration_Number1__c ?? '';
		const licese_text = `NSCP License #:`;
		doc.text(licese_text, margin.left, yPos+4); 
	
		const licenseTextWidth = doc.getTextWidth(licese_text);
		xPos = margin.left + licenseTextWidth;
		const _yPos = yPos + 4; 
		for (let offset = 0; offset < 0.3; offset += 0.1) {
			doc.text(license_number, xPos + offset, _yPos + offset);
		}

    //Center - Seal
    imageHeight = 37;
		imageWidth = 36;
        imageX = (pageWidth - imageWidth) / 2;
		doc.addImage(this.sealDataURL, 'PNG', imageX+3, yPos - 5 - imageHeight/2, imageWidth, imageHeight);

    // Right side: Signature
    const signatureText = 'Beverley Zwicker, CEO and Registrar';
    const signatureX =
      pageWidth - margin.right - doc.getTextWidth(signatureText) - 15;
    const lineYPos = yPos - 5;
    doc.line(signatureX, yPos - 5, signatureX + 90, yPos - 5);
    doc.text(signatureText, signatureX, yPos);

    const signatureImageHeight = 20; // Adjust as needed
    const signatureImageWidth = 50;
    doc.addImage(
      this.signatureDataURL,
      'JPEG',
      signatureX + 15,
      yPos - 21.5,
      signatureImageWidth,
      signatureImageHeight
    );

    doc.save('Certificate Pharmacy License.pdf');
  }
  catch(err){
    console.error(err.message);
  }
}

}